import React, { Component } from 'react';
export class Name extends Component {
    constructor(props) {
        super(props);
        this.state = {
            names: [
                "Ahmad Butt",
                "Ali Butt",
                "Abdullah Butt",
                "Akram Butt",
            ], index: props.initIndex,
        }
    }
    nextName = () => {
        if (this.state.index < (this.state.names.length - 1)) {
            this.setState({
                index: this.state.index + 1,
            })
        }
        else {
            this.setState({
                index: 0,
            })
        }
    }
    previousName = () => {
        if (this.state.index >= 0) {
            this.setState({
                index: this.state.index - 1,
            })
        }
        else {
            this.setState({
                index: this.state.names.length,
            })
        }
    }
    render() {
        return (
            <div>
                <h1>{this.state.names[this.state.index]}</h1>
                <button onClick={this.nextName}>Next Name</button>
                <button onClick={this.previousName}>Previous Name</button>
            </div>
        )
    }
}
